  

// TypeScript Version: 4.1

/**
* Computes the absolute value of single-precision floating-point number `x`.
*
* @param x - input value
* @returns absolute value
*
* @example
* var v = absf( -1.0 );
* // returns 1.0
*
* @example
* var v = absf( 2.0 );
* // returns 2.0
*
* @example
* var v = absf( 0.0 );
* // returns 0.0
*
* @example
* var v = absf( -0.0 );
* // returns 0.0
*
* @example
* var v = absf( NaN );
* // returns NaN
*/
declare function absf( x: number ): number;


// EXPORTS //

export = absf;
